SELECT ?sign ?internalName
WHERE {
  ?sign a witcher:Signs ;
        witcher:hasInternalName ?internalName ;
        geo:hasGeometry ?signGeometry .

  FILTER(?internalName = "miners_camp")

  <http://cgi.di.uoa.gr/witcher/resource/Codger_s_Quarry> geo:hasGeometry ?quarryGeometry .

  FILTER(geof:sfWithin(?signGeometry, ?quarryGeometry))
}


This query will find all signs that:
1. Are of type "Signs"
2. Have the internal name "miners_camp" 
3. Are spatially located within Codger's Quarry's geometry

