SELECT DISTINCT ?entity ?entityName ?location
WHERE {
  ?entity witcher:location ?location .
  ?entity rdfs:label ?entityName .
  FILTER(CONTAINS(LCASE(?location), "northwest of crow's perch"))
  {
    ?entity witcher:location ?blackboughLocation .
    FILTER(CONTAINS(LCASE(?blackboughLocation), "blackbough"))
  }
  UNION
  {
    ?entity witcher:location <http://cgi.di.uoa.gr/witcher/resource/Blackbough> .
  }
}

SELECT ?settlement ?settlementName
WHERE {
  ?settlement a witcher:Settlements ;
              geosparql:hasGeometry ?settlementGeometry .
  ?settlement rdfs:label ?settlementName .

  # Filter for settlements in Blackbough
  ?settlement witcher:locatedIn <http://cgi.di.uoa.gr/witcher/resource/Blackbough> .

  # Filter for settlements within Crow's Perch region geometry
  FILTER(geof:sfWithin(?settlementGeometry, <http://cgi.di.uoa.gr/witcher/resource/Crow_s_Perch_geometry>))
}

