        geosparql:hasGeometry ?signGeometry .

  BIND(<http://cgi.di.uoa.gr/witcher/resource/Crow_s_Perch_geometry> AS ?crowsPerchGeometry)

  FILTER(geof:sfWithin(?signGeometry, ?crowsPerchGeometry))
}

