SELECT (COUNT(DISTINCT ?whetstone) as ?count)
WHERE {
  # Get Whetstone items with their geometry
  ?whetstone a witcher:Whetstone ;
             geosparql:hasGeometry ?whetstoneGeom .

  # Get Byways geometry
  witcher:Byways geosparql:hasGeometry ?bywaysGeom .

  # Filter for Whetstones that are within Byways
  FILTER(geof:sfWithin(?whetstoneGeom, ?bywaysGeom))
}
